import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.scss';
import Home from './components';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/about">
              <div>Test</div>
            </Route>
            <Route path="/dashboard">
            <div>Test</div>
            </Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
